import s from './Navbar.module.css'
import {NavLink} from "react-router-dom";

const Navbar = () => {
    let navLinks= [
        {
            link:'Profile',
            path: '/profile'
        },
        {
            link:'Massage',
            path: '/dialogs'
        },
        {
            link:'News',

        },
        {
            link:'Music',

        },
        {
            link:'Settings',

        }
    ];
    return <nav className={s.nav}>
        {navLinks.map((el) => {
            console.log(el.hasOwnProperty('path'))
            // if(el.hasOwnProperty(el.path)){
